import React from 'react';
import './About.css';
import Header from './Header.js';
import Footer from './Footer.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Project from './Project.js';



class About extends React.Component {
  goAbout = () => {
    this.props.history.push("/about");
  }
  goHome = () => {
    this.props.history.push("/");
  }
  render() {
    return (
      <div class="about">
        <Header goToHome={this.goHome} goToAbout={this.goAbout} page={"about"}/>
        <div class="aboutintro">
          <Container fluid={true}>
            <Row noGutters={true}>
              <Col xs={12} sm={12} md={6}>
                <div>
                  <img src="https://png.pngtree.com/png-vector/20190830/ourlarge/pngtree-continuous-one-line-drawing-light-bulb-symbol-idea-and-creativity-isolated-png-image_1716617.jpg"/>
                </div>
              </Col>
              <Col xs={12} sm={12} md={6}>
                <div class="abouttext">
                  <div class="nicetomeet">Nice to meet you!</div>
                  <div>I'm an aspiring software engineer passionate about the intersection of business and technology.</div>
                  <div> Graduating Brown University with a degree in Computer Science and Economics.</div>
                </div>
              </Col>
            </Row>
          </Container> 
        </div>
        <div className="experiencesection">
          <div className="experiencetitle">What I'm up to after school </div>
            <div className="section-experience">
              <p>Co-director @ Hack@Brown</p>
              <p>📚 Organizing the largest and oldest hackathon on campus </p>
            </div>
            <div className="section-experience">
              <p>Teaching Assistant @ CS Department</p>
              <p>📚 Leading weekly sections and TA hours for CS0150 and CS0020</p>
            </div>
            <br></br>
          <div className="experiencetitle">Summertime Experiences </div>
            <div className="section-experience">
              <p>Software Engineer Intern @ Facebook</p>
              <p>🌞 Worked on projects that help make Facebook Communities a safer space</p>
            </div>
            <div className="section-experience">
              <p>Security Intern @ Deloitte</p>
              <p>🌞 Implemented features on internal for vulnerability management </p>
            </div>
        </div>
        <div className = "footercenter">
          <Footer />
        </div>
      </div>
    );
  }
}

export default About;
